INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (24001, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 10040, 0.0, 1, 102601, 24, 0.0, 0.0, 0, "あたしだって\nやるときはやるよ！", 1, "リン");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (24002, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 10040, 0.0, 1, 102601, 24, 0.0, 0.0, 1, "ふぅ…\nこれであたしの仕事は\n終わりだね", 1, "リン");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (24003, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 10040, 0.0, 1, 102601, 24, 0.0, 0.0, 2, "終わった終わった\n一人でもなんとか\nなるもんだね", 1, "リン");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (24004, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 10040, 0.0, 2, 102601, 24, 0.0, 0.0, 3, "やったね！\nこれでようやく\nサボれるよ…", 2, "リン");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (24005, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 10040, 0.0, 1, 102601, 24, 0.0, 0.0, 4, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 1, "リン");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (24006, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 10040, 0.0, 2, 102601, 24, 0.0, 0.0, 5, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 2, "リン");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (24007, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 10040, 0.0, 2, 102601, 24, 0.0, 0.0, 6, "あたしも意外と\nやるもんでしょ？", 2, "リン");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (24008, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 10040, 0.0, 4, 102601, 24, 0.0, 0.0, 7, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 4, "リン");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (24009, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 10040, 0.0, 4, 102601, 24, 0.0, 0.0, 8, "このままじゃ\nまっひ～に\n叱られちゃうよ", 4, "リン");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (24010, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 10040, 0.0, 4, 102601, 24, 0.0, 0.0, 9, "まじめに\nやったんだけどな…\n悔しいな～", 4, "リン");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (24011, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 10040, 0.0, 4, 102601, 24, 0.0, 0.0, 10, "やられた…\nねずみって意外と\nてごわいね", 4, "リン");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (24012, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 10040, 0.0, 4, 102601, 24, 0.0, 0.0, 11, "おのれ～\nあたしのチーズを\n盗みやがって～！", 4, "リン");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (24013, "2030/12/17 14:59:59", "2020/04/30 12:00:00", 10040, 0.0, 1, 102601, 24, 0.0, 1.81, 12, "疲れた…\nけど、次こそは\n守り抜くよ…", 4, "リン");
